# Tạo đối tượng BeautifulSoup để phân tích HTML
soup = BeautifulSoup(html_content, 'html.parser')

# Tìm tất cả các thẻ <a> có thuộc tính href chứa '/videos/'
# Regex: bắt đầu bằng '/', theo sau là một chuỗi số (user ID), rồi '/videos/', rồi một chuỗi số khác (video ID)
video_links = soup.find_all('a', href=re.compile(r"^/\d+/videos/\d+"))
i = 0
# In ra các link tìm được
print("Các link video tìm được:")
base_url = "https://www.facebook.com" # Giả sử đây là link từ Facebook
if video_links:
    for link in video_links:
        href = link.get('href')
        if href:
            i=i+1
            full_url = base_url + href
            print(full_url)
else:
    print("Không tìm thấy link video nào phù hợp trong đoạn mã.")

print(f"Tổng số link video tìm được: {i}")